INSERT INTO `query_doc_interpose_table`(query,doc_id,content,type,type_extend,rank_info) VALUES ('花', '36900c5baa654ee098eeb04b68bd66d2', '{\"sort\":2,\"type\":\"2\",\"typeExtend\":\"baikeBox\",\"title\":\"花_搜狗百科 \",\"digest\":\"杯子植物的繁殖器官   花， 英文Flower，常称为花朵，生物学上是被子植物的繁殖器官，其功能是结合雄性精细胞与雌性卵细胞以产生种子，在同一植物上着生的组合称为花序。裸子植物的花构造比较简单，无明显的花被,单性，形成雄球花和雌球花，而被子植物的花构造比较多样，所以通常所说的花是指被子植物的花。\",\"url\":\"https://baike.sogou.com/m/v110697.htm?fromTitle=%E8%8A%B1&rcer=uNz_alvVqvzeAE_5\",\"imgList\":[\"https://comsearch-manager-vivofs.vivo.com.cn/PdZMIJWI5rOnLL7f/c009342f44994df195605705abe19941/hua-2-1.png\"],\"labels\":[],\"source\":{\"title\":\"搜狗百科\",\"url\":\"\",\"icon\":\"\"}}', '2', 'baikeBox', '2');
